import Container from '@material-ui/core/Container';


import SwipeableTextMobileStepper from '../Components/Movies';


export default function Home() {
  return (
    <React.Fragment>
        <Container fixed>
        <img src={red} alt="red" />
             
            
            
            <SwipeableTextMobileStepper/>
            
        </Container>
    </React.Fragment>
  );
}
